  `charge_period` varchar(50) DEFAULT NULL COMMENT '등업 조건 2 (충전 기간)',
  KEY `vip_config_level` (`level`),
  CONSTRAINT `vip_config_level` FOREIGN KEY (`level`) REFERENCES `gl_member_level` (`level`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

