CREATE ALGORITHM=UNDEFINED DEFINER=`pi`@`localhost` SQL SECURITY DEFINER VIEW `gl_vip_list` AS select `mb_card`.`mb_no` AS `mb_no`,`mb_card`.`num` AS `num`,(case when ((select (sum(`charger`.`current_money`) * 100) from `gl_charger_state` `charger` where (`charger`.`card_num` = `mb_card`.`num`)) >= (select `gl_vip_config`.`charge_money` from `gl_vip_config` where (`gl_vip_config`.`level` = '3'))) then '3' when (((select (sum(`charger`.`current_money`) * 100) from `gl_charger_state` `charger` where (`charger`.`card_num` = `mb_card`.`num`)) >= (select `gl_vip_config`.`charge_money` from `gl_vip_config` where (`gl_vip_config`.`level` = '2'))) and ((select (sum(`charger`.`current_money`) * 100) from `gl_charger_state` `charger` where (`charger`.`card_num` = `mb_card`.`num`)) < (select `gl_vip_config`.`charge_money` from `gl_vip_config` where (`gl_vip_config`.`level` = '3')))) then '2' else '1' end) AS `level_code`,(select `e`.`level_name` from `gl_member_level` `e` where (`e`.`level` = `level_code`)) AS `level_name` from `gl_member_card` `mb_card` where `mb_card`.`num` in (select `state`.`card_num` from `gl_charger_state` `state` where (`state`.`input_date` between (curdate() + interval -((select `gl_vip_config`.`charge_period` from `gl_vip_config` where (`gl_vip_config`.`level` = (case when ((select (sum(`charger`.`current_money`) * 100) from `gl_charger_state` `charger` where (`charger`.`card_num` = `mb_card`.`num`)) >= (select `gl_vip_config`.`charge_money` from `gl_vip_config` where (`gl_vip_config`.`level` = '3'))) then '3' when (((select (sum(`charger`.`current_money`) * 100) from `gl_charger_state` `charger` where (`charger`.`card_num` = `mb_card`.`num`)) >= (select `gl_vip_config`.`charge_money` from `gl_vip_config` where (`gl_vip_config`.`level` = '2'))) and ((select (sum(`charger`.`current_money`) * 100) from `gl_charger_state` `charger` where (`charger`.`card_num` = `mb_card`.`num`)) < (select `gl_vip_config`.`charge_money` from `gl_vip_config` where (`gl_vip_config`.`level` = '3')))) then '2' else '1' end)))) day) and (curdate() + interval 1 day))) group by `mb_card`.`num` order by `mb_card`.`mb_no` ;

